Vue.createApp({
  data() {
    return {
      animal: "",
    };
  },
  computed: {
    getImage() {
      if (this.animal == "Gato") {
        return "data:image/jpeg;base64,";
      } else if (this.animal == "Perro") {
        return "data:image/jpeg;base64,";
      } else if (this.animal == "Pato") {
        return "data:image/jpeg;base64,";
      }
    },
  },
}).mount("#app");
